import './Navigation.css'
import { LINK } from 'react-router-dom';

export default function Navigation() {
	return (
			<div>
				<div className='nav'>
					<LINK className='item' to={'/'}>Home</LINK>
					<LINK className='item' to={'/menu'}>Menu</LINK>
					<LINK className='item' to={'/user'}>User</LINK>
				</div>
			</div>
	  );
}
